import React from "react";
import { useDispatch, useSelector } from "react-redux";
import { loadFilmsSecond } from "../../store/SecondFilm/actions"; 
import { selectFilmsSecond } from "../../store/SecondFilm/selector";
import routeSecond from "./routes";
import { useEffect } from "react";
import NewsList from "../../components/NewList";
import "./styles.scss";


import { TypedDispatch } from "../../store";




const SecondPage =()=>{

  const dispatch = useDispatch<TypedDispatch>();
  const newsList = useSelector(selectFilmsSecond);

    useEffect(() => {
      dispatch(loadFilmsSecond());
   
    }, []);
    return(
        <div className="secondpage">

            <div className="secondpageitem">
            <div className="secondtext">Выбранная категория: <span> CAR</span>
          
          </div>
      {newsList.length > 0 && <NewsList list={newsList.slice(0, 20)} />}
      </div>
        </div>
    )
}
export{routeSecond};
export default SecondPage;
